import { createRouter, createWebHistory } from 'vue-router';
import Layout from '../views/LayoutView.vue'; // 레이아웃 컴포넌트
import CategoryView from '../views/CategoryView.vue'; // 카테고리 컴포넌트
import CommunityView from '../views/CommunityView.vue'; // 커뮤니티 컴포넌트
import GuidelinesView from '../views/GuidelinesView.vue'; // 이용안내 컴포넌트
import MyBooksView from '../views/MyBooksView.vue'; // 나만의책장 컴포넌트

const routes = [
  {
    path: '/',
    name: 'Home',
    component: LayoutView,
    children: [
      { path: 'category', component: CategoryView }, // 카테고리 페이지
      { path: 'community', component: CommunityView }, // 커뮤니티 페이지
      { path: 'guidelines', component: GuidelinesView }, // 이용안내 페이지
      { path: 'mybooks', component: MyBooksView }, // 나만의책장 페이지
    ],
  },
  { path: '/login', name: 'Login', component: () => import('../views/LoginView.vue') },
  { path: '/signup', name: 'Signup', component: () => import('../views/SignupView.vue') },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
